class ExA extends RuntimeException {  ExA(String s) {    super(s);  }}public class throw_12_tryC_throw_C_tryC {  public static void main(String[] args) {    try {      try {        if (true) throw new ExA("ex");        System.out.println("unreachable");      } catch(ExA e) {        System.out.println("caught ExA: " + e.toString());        throw new RuntimeException("re");      } catch(RuntimeException e) {        System.out.println("caught re: " + e.toString());      }      System.out.println("unreachable");    } catch (RuntimeException e) {      System.out.println("caught re 2: " + e.toString());    }    System.out.println("Done!");  }}